import React from 'react';

function RecyclageResultats({ recyclageResultats }) {
  return (
    <div className="result-container">
    <h2>Your waste is:</h2>
    <div className="result-textarea">
      <textarea
        value={recyclageResultats}
        rows={4}
        cols={40}
        readOnly
        placeholder="Model's result..."
      />
    </div>
  </div>
  );
}

export default RecyclageResultats;
